import React from "react";
import styles from './LayOut.module.scss'
import GetDataFromSNKRDUNK from "../GetDataFromSNKRDUNK";
import GetDataFromSoldOut from "../getDataFromSoldOut";

function Layout({submitCode}) {
    return (
        <div className={styles.wrapper}>
            <div className={styles.jpSegment}>
                <GetDataFromSNKRDUNK submitCode={submitCode} />
            </div>
            <div className={styles.korSegment}>
                <GetDataFromSoldOut submitCode={submitCode} />
            </div>
        </div>
    )
}

export default Layout
